                'h-[0px]': !agreeOpen,
                'h-[678px]': agreeOpen,
            })}>
                <div className='w-[30px] h-[30px] bg-black rounded-full'>
                    <button onClick={(e: React.MouseEvent<HTMLButtonElement>) => setAgreeOpen(false)}>
                        <img src={Close} alt={'닫기'}/>
                    </button>
                </div>
